import logo_truong from '../../../assets/logo_truong.svg'

const Sidebar = () => {
    return (
        <div className="sidebar">
            <header className="sidebar-header">
                <img src={logo_truong} height="100%" alt="logo" />
            </header>
        </div>
    )
}

export default Sidebar
